import React from 'react';
import { Link } from 'react-router-dom';
function Navbar(){
    return(
        <div className='navbar'>
            <div className='leftSide'>
                <img src = "/images/logo1.png"/>
            </div>
            <div className='rightSide'>
               <Link to="/"></Link> 
            </div>
        </div>
    );
}

export default Navbar;
